import React from "react";
import "./Logout.css";

const Logout = () => {
  return (
    <div className="logout">
      <div className="header">
        <div id="fitness-title">
        <FitnessCenterIcon
            style={{ fontSize: "1.9em" }}
          />
          <h1>Fitness App</h1>
        </div>
      </div>
    </div>
  );
};

export default Logout;
